import logo from './logo.svg';
import './App.css';
import React from 'react';
import ReactDOM from 'react-dom' 

function App() {
  const [word, setWord] = React.useState('software');
  const [associations, setAssociations] = React.useState(null);
  const getAssociations = async () => {
    const response = await fetch('/api/associations/' + word);
    const data = await response.json();
    setAssociations(data);
    console.log(Object.keys(associations).length)
    // fetch('/api/associations/' + word)
    //   .then(result => result.json())
    //   .then(body => setAssociations(body));
     // console.log(Object.keys(associations).length)
  };

  const getKeys = () => {
    return Object.keys(associations);
  }
  const getHeader = () => {
    var keys = this.getKeys();
    return keys.map((key, index) =>{
      return <th key={key}>{key.toUpperCase()}</th>
    })
  }

  const RenderRow = (props) =>{
    return props.keys.map((key, index)=>{
    return <td key={props.data[key]}>{props.data[key]}</td>
    })
   }


  const getRowsData = function(){
    var items = this.props.data;
    var keys = this.getKeys();
    return items.map((row, index)=>{
      return <tr key={index}><RenderRow key={index} data={row} keys={keys}/></tr>
    })
    }

  return (
    <div className="app">
      <h1>Word Associations Map</h1>
      <input value={word} onChange={e => setWord(e.target.value)} />
      <button onClick={getAssociations}>Find Associations</button>
      {associations && (
        Object.keys(associations).length === 0
          ? <p>No results</p>
          : <div key={"table list"}>
              <table>
                <thead>
                  <tr>{}</tr>
                </thead>
              </table>
            </div>
      )}
    </div>
  );
}

export default App;
